import React from "react";
import MoviesData from "./Movies";
import Movie from "./mala7ala";
function Movieslist({e}) {
  return (
    <div>
      {MoviesData.map((e) => (
        <Movie e={e} />
      ))}
    </div>
  );
}

export default Movieslist;
